import React from 'react';
import './Modal.css'


interface PropsType{
    closeModal: (x: React.MouseEvent) => void
    showModal: boolean;
}

const Modal: React.FC <PropsType>= ({closeModal,showModal}) => {

    return (
        <div className='wrapper-modal'>

        </div>
   
    );
};

export default Modal;
